import React from 'react';
import './App.css';
import Header from './components/Header';
import Navbar from './components/Navbar';


function App() {
  return (
    <div className="app-wrapper">
      <Header />
      <Navbar />
      <div className="content">
        <div>
          <img src="https://platform-news.com/ru/wp-content/themes/platform-news/img/slider/01.jpg"></img>
        </div>
        <div>ava and describtion</div>
        <div>
          my post
           <div>new post</div>
           <div>
             <div>post1</div>
             <div>post2</div>
             <div>post3</div>
           </div>
        </div>
      </div>
    </div>
  );
}

export default App;
